/* Event structure for event `test` */

/*!50106 DROP EVENT IF EXISTS `test`*/;

DELIMITER $$

/*!50106 CREATE DEFINER=`root`@`localhost` EVENT `test` ON SCHEDULE EVERY 1 DAY STARTS '2016-12-11 00:00:00' ON COMPLETION PRESERVE ENABLE DO call newDay() */$$
DELIMITER ;

/* Event structure for event `test1` */

/*!50106 DROP EVENT IF EXISTS `test1`*/;

DELIMITER $$

/*!50106 CREATE DEFINER=`root`@`localhost` EVENT `test1` ON SCHEDULE EVERY 1 MONTH STARTS '2017-02-10 02:00:00' ON COMPLETION PRESERVE ENABLE DO DELETE FROM hyjcy_diningrecord_his WHERE DAY IN (SELECT DAY FROM (SELECT * FROM hyjcy_diningrecord_his GROUP BY DAY ASC LIMIT 30) AS a) */$$
DELIMITER ;

/* Procedure structure for procedure `newDay` */

/*!50003 DROP PROCEDURE IF EXISTS  `newDay` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `newDay`()
begin
insert into hyjcy_diningrecord_his(day, lunch, dinner, userId) select DAY, lunch, dinner, userId from hyjcy_diningrecord_today;
delete from hyjcy_diningrecord_today;
insert into hyjcy_diningrecord_today(DAY, lunch, dinner, userId) select CURDATE(), '1', '0', id from hyjcy_user where id <> 1;
end */$$
DELIMITER ;

